    const[error,setError]=useState(null)

    console.log=(email,password,confirmPassword)

    const handleClick = () =>{
        setShowModal(false)

    }
    const handleSubmit = (e) =>{
        e.preventDefault()
    }
    const isSignUp = true;

    return(
        <div className="auth-modal">
            <div className="close-icon" onClick={handleClick}>â“§</div>
