                onChange={(e) => setEmail(e.target.value)}

                />
                <input
                type="password"
                id="password"
                name="password"
                placeholder="password"
                required={true}
                onChange={(e) => setPassword(e.target.value)}

                />
                <input
                type="password-check"
                id="password-check"
                name="password-check"
                placeholder="confirm password"
                required={true}
                onChange={(e) => setConfirmPassword(e.target.value)}

                />

            </form>
            AUTH MODEL
        </div>
    )
}
export default AuthModal
